import React from 'react'
import Nav from '../Nav'

export default class Contact extends React.Component{
  render(){
    return(
      <div>
        <Nav />
        <div className="about-me">
          <div className="form">
            <h2>Contact Me</h2>
            <p>E-mail</p><input></input>
            <textarea></textarea>
          </div>
        </div>
      </div>
    )
  }
}
